$(function(){
	var canvas = document.getElementById('canvas');
    var context = canvas.getContext('2d');

    //SHOW LOADER
    var image=new Image();
	image.onload=function() {
		//CLOSE THE LOADER
	    context.drawImage(image, 0, 0);
	};
	image.crossOrigin= "use-credentials";
	image.src = "data:image/jpeg;base64,";

	$("#canvas").mousemove(function(e){
		
		var offsetBox = $("#canvas").offset();

		var x = e.pageX - offsetBox.left - 1;
		var y = e.pageY - offsetBox.top;

		var pixelColor = context.getImageData(x, y, 1, 1).data;

		var color = "rgba("+pixelColor.join(", ")+")";
		//console.log(color);

		$("#colorBox").css("background-color", color);

		$("#colorMouseBox").css({"top": y+5, "left": x, "background-color": color});
		$("#colorMouseBox").show();
	});

});